import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'ByteBank';

  transferir($event){
    console.log($event);
  }
}
<nova-transferencia (aoTransferir)="transferir($event)"></nova-transferencia>
